import Task from "../task";

const TaskList = ({ data }) => {
  const elements = data.map((el) => {
    const { id, ...itemProps } = el;
    return (
      <li>
        <Task {...itemProps} key={id} />
      </li>
    );
  });
  return <ul className="todo-list">{elements}</ul>;
};

export default TaskList;
